        public static string hackerrankInString(string s)
        {
            Stack<char> input = new Stack<char>();
            foreach (var c in s)
                input.Push(c);
            var expect = "hackerrank";
            Stack<char> expected = new Stack<char>();
            foreach (var c in expect)
                expected.Push(c);

            for (int i = 0; i < 10; i++)
            {
                var exp = expected.Pop();

                if (input.Count == 0)
                    return "NO";

                var inp = input.Pop();

                if (exp == inp)
                {
                    if (i == 9)
                        return "YES";
                    else
                        continue;
                }
                else
                    while (exp != inp)
                    {
                        if (input.Count == 0)
                            return "NO";
                        inp = input.Pop();
                    }
                if (i == 9 && exp == inp)
                    return "YES";
                //if (i == expected.Count - 1 && exp == inp)
                //    return "YES";
                //else return "NO";
            }
            return "NO";
        }

